import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for product cards to load and click the first one
    await page.waitForSelector('.product-card');
    await page.click('.product-card:first-child');

    // Wait for product detail modal to appear
    await page.waitForSelector('#productModal', { state: 'visible' });
    await page.waitForSelector('.product-detail-title');

    // Take screenshot of the open modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Extract product details from the modal
    const productTitle = await page.$eval('.product-detail-title', el => el.textContent.trim());
    const productPrice = await page.$eval('.product-detail-price', el => el.textContent.trim());
    const productRating = await page.$eval('.product-detail-rating .rating-text', el => el.textContent.trim());

    return {
      success: true,
      action: "Successfully opened product detail modal by clicking on first product card",
      extractedData: {
        productTitle,
        productPrice,
        productRating
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to open product detail modal",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
